    <main className='App'>
    <div >
            <button className={mode ? "white" : "black"}>Night Mode</button>
        <h1>Rick&Morty Adventures {Home}</h1>
            <img src= "https://fondosmil.com/fondo/27341.png" alt="Fondo Rick&Morty"></img>
        </div>
    </main>
    </>
}

export default Home
